import { NgModule } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { LoginComponent } from './Webcomponent/userLogin/login.component';
import { SignupComponent } from './Webcomponent/signup/signup.component';
import { CartComponent } from './Webcomponent/cart/cart.component';
import { HomePageComponent } from './Webcomponent/home-page/home-page.component';
import { MobilesComponent } from './Webcomponent/mobiles/mobiles.component';
import { LaptopsComponent } from './Webcomponent/laptops/laptops.component';
import { BagsComponent } from './Webcomponent/bags/bags.component';
import { DecoratorsComponent } from './Webcomponent/decorators/decorators.component';

@NgModule({
  declarations: [
    AppComponent,
    LoginComponent,
    SignupComponent,
    CartComponent,
    HomePageComponent,
    MobilesComponent,
    LaptopsComponent,
    BagsComponent,
    DecoratorsComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
